USE `ge_baseproject`;

CREATE TABLE `applog` (
  `aid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `aname` varchar(20) NOT NULL DEFAULT '',
  `aver` varchar(10) NOT NULL DEFAULT '',
  `adate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `alog` text,
