  `tgledit` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`idjabatan`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `karyawan` (
  `idkaryawan` int(11) NOT NULL AUTO_INCREMENT,
  `nik` varchar(20) NOT NULL,
  `noktp` varchar(30) DEFAULT '',
  `nama` varchar(40) DEFAULT '',
  `jnskelamin` enum('Laki-laki','Perempuan') DEFAULT NULL,
  `alamat` varchar(100) DEFAULT '',
  `notelp` varchar(20) DEFAULT '',
  `idjabatan` int(11) DEFAULT NULL,
  `tgledit` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `tptlahir` varchar(30) DEFAULT '',
  `tgllahir` date DEFAULT NULL,
  `goldarah` varchar(2) DEFAULT '',
  `img` blob,
  PRIMARY KEY (`idkaryawan`),
  KEY `idjabatan` (`idjabatan`),
  CONSTRAINT `karyawan_jabatan` FOREIGN KEY (`idjabatan`) REFERENCES `jabatan` (`idjabatan`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `setting` (
  `nama` varchar(20) NOT NULL,
  `nilai` blob,
  PRIMARY KEY (`nama`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `tempnomor` (
  `idnomor` int(11) NOT NULL AUTO_INCREMENT,
  `tabel` varchar(20) DEFAULT NULL,
  `noakhir` int(11) DEFAULT NULL,
  `prefix` varchar(5) DEFAULT NULL,
  PRIMARY KEY (`idnomor`),
  UNIQUE KEY `prefix` (`prefix`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

CREATE TABLE `user_level` (
  `idlevel` int(11) NOT NULL AUTO_INCREMENT,
  `namalevel` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`idlevel`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

CREATE TABLE `user` (
  `iduser` int(11) NOT NULL AUTO_INCREMENT,
  `uname` varchar(20) DEFAULT NULL,
  `nama` varchar(40) DEFAULT NULL,
  `idkaryawan` int(11) DEFAULT NULL,
  `pwd` varchar(50) DEFAULT NULL,
  `idlevel` int(11) NOT NULL,
  `aktif` tinyint(4) DEFAULT '1',
  `tgledit` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`iduser`),
  UNIQUE KEY `uname` (`uname`),
  KEY `idlevel` (`idlevel`),
  CONSTRAINT `user_level` FOREIGN KEY (`idlevel`) REFERENCES `user_level` (`idlevel`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 AVG_ROW_LENGTH=16384 PACK_KEYS=0;

CREATE TABLE `user_hakakses` (
  `idlevel` int(11) NOT NULL DEFAULT '0',
  `idmenu` int(11) NOT NULL,
  `status` tinyint(1) DEFAULT '0',
  `tambah` tinyint(1) DEFAULT '0',
  `ubah` tinyint(1) DEFAULT '0',
  `hapus` tinyint(1) DEFAULT '0',
  `cetak` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`idlevel`,`idmenu`),
  KEY `idmenu` (`idmenu`),
  KEY `iduser` (`idlevel`),
  CONSTRAINT `user_hakakses_level` FOREIGN KEY (`idlevel`) REFERENCES `user_level` (`idlevel`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

